class User {
    constructor(
        id, 
        firstName, 
        lastName, 
        city, 
        profilePicUrl
        ){
        this.id = id;
        this.firstName = firstName;
        this.lastName = lastName;
        this.city = city;
        this.profilePicUrl = profilePicUrl;
    }
}

export default User
